INSERT INTO `review` (`review_id`, `collection_type`, `collection_id`, `account_id`, `review_text`, `review_date`, `review_rate`) VALUES
(1, 'trail', 173, 1, 'sss', 1349852400, 4.00),
(2, 'trail', 173, 1, 'What a beautiful day to get out on the trail. A cool but crystal clear day. As expected, there were many others using the trails today including mountain bikers and horse riders. We hiked the Outback loop up to and including the Ponderosa loop trail and then back again. The wildflowers are in full bloom and beautiful. An easy hike with some moderate ups and downs. Just right to get the blood pumping and get the dog some exercise. This trail system is right in the town of Grants Pass and adjacent to the golf course and other private residences. It''s easy to ignore the occasional glimpses of the real world and get the feeling you are in real wilderness.', 1223794800, 5.00),
(3, 'trail', 173, 1, 'What a beautiful day to get out on the trail. A cool but crystal clear day. As expected, there were many others using the trails today including mountain bikers and horse riders. We hiked the Outback loop up to and including the Ponderosa loop trail and then back again. The wildflowers are in full bloom and beautiful. An easy hike with some moderate ups and downs. Just right to get the blood pumping and get the dog some exercise. This trail system is right in the town of Grants Pass and adjacent to the golf course and other private residences. It''s easy to ignore the occasional glimpses of the real world and get the feeling you are in real wilderness.', 1409814000, 5.00),
(4, 'trail', 173, 1, 'What a beautiful day to get out on the trail. A cool but crystal clear day. As expected, there were many others using the trails today including mountain bikers and horse riders. We hiked the Outback loop up to and including the Ponderosa loop trail and then back again. The wildflowers are in full bloom and beautiful. An easy hike with some moderate ups and downs. Just right to get the blood pumping and get the dog some exercise. This trail system is right in the town of Grants Pass and adjacent to the golf course and other private residences. It''s easy to ignore the occasional glimpses of the real world and get the feeling you are in real wilderness.\n', 1402556400, 3.00);
