(172, 'Babyfoot Lake Rim #1126', 'babyfoot-lake-rim-1126', 'This trail provides a view of many wildflowers (Babyfoot Lake Botanical Area). The trail follows the ridge west of Babyfoot Lake and provides access to the Kalmiopsis Rim Trail #1124 (old mining road section) within the Kalmiopsis Wilderness.\nThe trail up to the rim is steep and rocky in places, but gets easier at the rim.\nThere are some good views looking down at Babyfoot Lake and across the Kalmiopsis Wilderness area.\n <br /><br />\nThis trail is located in the Biscuit Fire area that burned in the year 2002. Visitors should take into consideration (because of the substantially increased risk of fire-killed snags falling) that travel and camping may be more difficult and require greater concern for safety.\n<br />\n<h4 class="text-primary">Connecting Trails</h4>\n<a href="#trails/babyfoot-lake-1124a">Babyfoot Lake #1124a</a>', ' -123.8143242471333,42.21284210019304,0 -123.814327345984,42.21284213137926,0 -123.7929382429489,42.22476774263073,0 -123.7930062502517,42.2245736373694,0 -123.7930924605546,42.22444244971776,0 -123.7931786704795,42.22431126197832,0 -123.7932946979731,42.22420238450659,0 -123.793409370955,42.22398544017809,0 -123.7934955795267,42.22385425211948,0 -123.7936109431786,42.22372286198127,0 -123.7937255587161,42.22350141528407,0 -123.79375037539,42.2231545013748,0 -123.7937435564381,42.22260966664751,0 -123.793681602967,42.22234891300376,0 -123.7937073035468,42.22204252227664,0 -123.7936723049127,42.221605958449,0 -123.7936988535706,42.22136710840808,0 -123.7938122228195,42.22104659954947,0 -123.7938898737469,42.22089745770586,0 -123.7941874908034,42.22062520855503,0 -123.7944508186814,42.22057835301614,0 -123.7946843898989,42.22051369034072,0 -123.7952996355042,42.22050942662833,0 -123.7954163463768,42.2204861012029,0 -123.7956799553609,42.22046175575204,0 -123.7958550664368,42.22041550925511,0 -123.7960883550859,42.22032833035485,0 -123.7962345946853,42.22030480079008,0 -123.79640947