(173, 'Babyfoot Lake #1124A', 'babyfoot-lake-1124a', 'This trail provides a view of many wildflowers and old growth timber. Babyfoot Lake is a high mountain lake with a few small Eastern Brook Trout. The lake is about a mile from the trailhead and is located within the Kalmiopsis Wilderness. The trail also provides access to the Babyfoot Lake Botanical Area. There area a few short but steep rocky sections. Beyond Babyfoot Lake, the trail is getting hard to follow.\nThis trail is located in the Biscuit Fire area that burned in the year 2002. Visitors should take into consideration (because of the substantially increased risk of fire-killed snags falling) that travel and camping may be more difficult and require greater concern for safety.', ' -123.8022942073388,42.22240531652659,0 -123.8025732180939,42.22258874458952,0 -123.8028307637334,42.22271302918689,0 -123.8031210787142,42.22282357605176,0 -123.8033253883683,42.22284015698789,0 -123.8033943916446,42.22281715818013,0 -123.8035099025519,42.22269926658778,0 -123.8036377287223,42.22238765402834,0 -123.8037555466185,42.22224272775408,0 -123.8040737856077,42.22204686189653,0 -123.8046993764747,42.22172275179245,0 -123.8049428360041,42.22157243814139,0 -123.805255209834,42.22175037189825,0 -123.8055108303957,42.22190168384678,0 -123.8057318095062,42.2220982687976,0 -123.8059267281911,42.22215093828853,0 -123.8060507750817,42.22225814173667,0 -123.8060736856918,42.22269028218354,0 -123.806139040816,42.22294650230663,0 -123.8063248948775,42.22317935990394,0 -123.8065515381709,42.2233443821105,0 -123.806796680589,42.22350477073653,0 -123.8069223705596,42.22371103166448,0 -123.8070564150714,42.22380015080829,0 -123.8076617761296,42.22399852984501,0 -123.8081404472283,42.22417978746187,0 -123.8087437299356,42.22448174785109,0 -123.8091308351286,42.22466815067367,0 -123.8097188006052,42.22516384850731,0 -123.8098990235575,42.22522111693866,0', ' -123.8022942073388,42.22240531652659', 1, 1411648162),
