(192, 'Bear Camp Ridge Trail #1147', 'bear-camp-ridge-trail-1147', 'A short trail that runs along Bear Camp Ridge, the highest portion of the Galice Ranger District. This trail offers spectacular views, a wide variety of wildflowers and cool summer time hiking. Wildlife and wildflower viewing, pleasantly cool high elevation hike in the summer months.\nTrail goes 1.5 miles down Bear Camp Ridge and comes out at road 2308 and spur road 016 (to Elk Wallow dispersed camp), along road 2308 for a few hundred feet then up to Elk Wallow Viewpoint. The second Trailhead is approximately 4.0 miles down the 2308 road. At this Trailhead is the 0.5 mile section to Craggies Viewpoint and an approximate 4 mile hike to Squirrel Camp which goes under Brandy Peak (an undeveloped path can get you to the peak). There is another undeveloped trail to Squirrel Peak, elevation 4,400 feet at Squirrel Camp.<br /><br />\nThis trail is located in the Biscuit Fire area that burned in the year 2002. Although Forest Service trail crews have been repairing and maintaining many of the affected trails since the Biscuit Fire, visitors should take into consideration (because of the substantially increased risk of fire-killed snags falling) that travel and camping may be more difficult and require greater concern for safety.', ' -123.8489557971986,42.6141129093445,0 -123.8489546113506,42.61411742283309,0 -123.8488177456879,42.61463912182747,0 -123.8487978235694,42.61471511422641,0 -123.8487458986706,42.61491317924645,0 -123.8487240840033,42.61515479765045,0 -123.8487254274032,42.61525385147264,0 -123.8487140327915,42.61531247268503,0 -123.8486547710423,42.61546601016426,0 -123.8485611585795,42.6156152986492,0 -123.8484675762036,42.6157105529797,0 -123.8483130966653,42.61592333282078,0 -123.8481624428417,42.6161090668502,0 -123.8477048149226,42.61655824156074,0 -123.8470944319495,42.61706707943122,0 -123.8467126376404,42.61723651028549,0 -123.8465597935259,42.61723313566104,0 -123.8459493940622,42.6174042