(210, 'Bailey Mountain #1109', 'bailey-mountain-1109', 'The trail is steep, and rugged that is currently being maintained from the Baily Cabin Trail down to the upper Chetco Wild and Scenic River at Carter Creek and down stream to Slide Creek.  From Little Chetco River up to Baily Mountain, the trail is no longer visible or passable.  The Bailey Mountain trail is located in the heart of the Kalmiopsis Wilderness.\nAlong the trail, close to Bailey Mountain, the rare endemic Kalmiopsis leacheana, for which the wilderness was names, grows in abundance.  The spring rhododendron, azaleas, and lupines create a vibrant colorful displays.\nFrom Bailey Mountain to Carter Creek it is 2.1 miles with a 2,000 foot descent.  There is one major river crossing involving knee deep water at Blake''s Bar, between Carker Creek and Slide Creek the old road up to Chetco Pass is in very poor condition.\n<br /><br />\nThis trail is located in the Biscuit Fire area that burned in the year 2002. Visitors should take into consideration (because of the substantially increased risk of fire-killed snags falling) that travel and camping may be more difficult and require greater concern for safety.\n', ' -123.8702033310331,42.25869243490774,0 -123.8702115968504,42.25870117361163,0 -123.8845596006378,42.21998204711872,0 -123.8845842140563,42.22008067874636,0 -123.8846060847508,42.22048128902499,0 -123.8845626655521,42.22057168565765,0 -123.8844686479836,42.22053638602185,0 -123.8842548719425,42.22041194714569,0 -123.8841367483098,42.22041285852308,0 -123.8840446790868,42.2204901203148,0 -123.8840771508166,42.22080959230112,0 -123.8842538780907,42.22107391539333,0 -123.8842510288745,42.22122254016784,0 -123.8840379918003,42.22131424486431,0 -123.8838297498257,42.22142392473423,0 -123.8837203190379,42.22158688021498,0 -123.8837346209035,42.22185245473572,0 -123.8837264723808,42.22197410279239,0 -123.8835961403879,42.22229482789926,0 -123.8834971718649,42.22258379036749,0 -123.8835353658208,42.2231508