(281, 'Beaver Dam Trail #1001', 'beaver-dam-trail-1001', 'The Beaver Dam Trail offers an opportunity to leisurely explore the edge between two different types of habitat; stream side and forest. The setting is the confluence of three small creeks, which drains the southern Dead Indian Plateau. Beaver Dam Creek, Daley Creek and Deadwood Creek flow lazily through an area of grassy banks, false hellebore, and Beaver ponds. The trail connects Beaver Dam and Daley Creek Campgrounds forming a partial loop. A range fence encloses the area protecting the riparian area from range cattle.<br /><br />\nAs you walk along the Beaver Dam Trail you are shaded by large Douglas fir, white pine and white fir with an understory of Pacific yew - recognized by its reddish peeling bark and dark green, flat, short pointed needles. The Pacific yew is poisonous; eating the foliage or seeds (contained in bright red berries) can result in death. Despite its small size the yew has proven very useful over the years. Native Americans used the wood for archery bows and canoe paddles. Today a local craftsman makes bows for violins and cellos. No wood is more resistant to decay and the yew is favored for fence posts. In recent years the bark has been used with promising results in cancer research.<br /><br />\nThe yew is a shade loving tree which dies when the canopy overhead is removed. Once abundant, it is now found primarily among pockets of old growth forest along stream banks and in shady canyons.<br /><br />\nIf you hike the trail in the early season, look for wildflowers including bleeding heart, calypso orchid, and trillium. You will also see several dead trees or "snags" that have become home for a variety of cavity nesting birds such as the large and colorful pileated woodpecker and the redbreasted nuthatch, whose call (a low nasal sounding "yaahnk....yaahnk") can be heard in these woods.\nWatch overhead above the creek and listen for the raucous chatter of the belted Kingfisher who makes his livelihood by capturing small fish in a headlong dive to the water. The bank of the creek will reveal evidence of beaver gnawed branches. If you quietly walk the trail in the early morning or evening you may be the lucky one who catches a glimpse of this furry engineer at work on one of the several active dams visible from the trail.', ' -122.367523467084,42.30363071659954,0 -122.3671263287977,42.30330394704844,0 -122.3666681296307,42.30256742292747,0 -122.3665153375902,42.3024540040594,0 -122.3663630903708,42.30228655008397,0 -122.366210686877,42.30228570828754,0 -122.3659818742469,42.30234298301472,0 -122.365905465029,42.30240110149612,0 -122.3659053094008,42.30256771201462,0 -122.3660586575399,42.30285225226118,0 -122.3662112630862,42.30336193699237,0 -122.3662895723256,42.30523112965184,0 -122.3663657857709,42.30534412607504,0 -122.3664425861538,42.3053985882116,0 -122.3664427750635,42.30568228028859,0 -122.3665191597618,42.30585381761198,0 -122.3669022472456,42.305933424987,0 -122.3670534122726,42.3059648388484,0 -122.3671294100077,42.30602379682396,0 -122.3674342808233,42.30602097623204,0 -122.3675866914382,42.3060218163545,0 -122.3679684919113,42.3061364961051,0 -122.3680447072631,42.30624949128776,0 -122.3681207534392,42.30630394712198,0 -122.3680452945878,42.30664576189879,0 -122.3678929233015,42.30709522572375,0 -122.3678172691286,42.30715334846063,0 -122.3677414383689,42.30760773638659,0 -122.3675124313607,42.30806128081857,0 -122.3674369891241,42.30817344103088,0 -122.3673602063952,42.30834413190303,0 -122.3672081958078,42.30868102220737,0 -122.3671325365376,42.30873914441862,0 -122.3669035317279,42.30873787976537,0 -122.3667506960859,42.30885411541839,0 -122.3667518785779,42.30941700106717,0 -122.3666754609911,42.30947511784574,0 -122.3664464510183,42.3094738540799,0 -122.3660643877825,42.30885482772029,0 -122.3660642330253,42.30834148126478,0 -122.3661406049284,42.3082878662098,0 -122.3663181130884,42.30717831042801,0', ' -122.367523467084,42.3036