(302, 'Anderson Camp #1075', 'anderson-camp-1075', 'This short trail leaves Forest Service road 6515, climbing 1,100 feet in elevation to join the Rogue-Umpqua Divide Trail 1470. The trail meanders through a series of small meadows. As the trail nears the top, it passes through a large, grassy meadow where the tread may be difficult to distinguish. The trail follows along the east side of a small pond and heads uphill in a west-northwest direction to Anderson Camp, just below the crest of the mountain.\nAnderson Camp was a turn-of-the century sheepherderâ€™s camp. The name evidently commemorates an early sheep header, Frank Anderson.\nNOTE: Due to low volume of use, the trail receives limited maintenance. Be prepared to encounter brush and downed logs.', ' -122.4770135837135,42.98181682035454,0 -122.4769366589058,42.98175793664064,0 -122.4763980242901,42.98091350136426,0 -122.4759369519731,42.98068626407616,0 -122.4753220752568,42.98006660076534,0 -122.4751680788874,42.97978673847669,0 -122.4752448416542,42.97950343091744,0 -122.4752451065619,42.97911171225452,0 -122.4749373531611,42.97888517555664,0 -122.4747067487713,42.97860045744032,0 -122.4746297164651,42.9783749774322,0 -122.4743996522074,42.97820732710807,0 -122.4740150627062,42.9780929985025,0 -122.4734777114832,42.97809502947663,0 -122.4733238393028,42.9779817586812,0 -122.4733240332784,42.97786919639822,0 -122.4732470802689,42.97781481188176,0 -122.473247088866,42.97736456014893,0 -122.4730164985665,42.97707983807992,0 -122.472785982291,42.97696621399739,0 -122.4727856785085,42.97691218164667,0 -122.4717868676757,42.9762907305234,0 -122.471633466211,42.97612342910384,0 -122.4710952981388,42.9759543490377,0 -122.4705574665196,42.97538904791631,0 -122.4707105890909,42.97505206585055,0 -122.4701728630373,42.97420760471446,0 -122.4693277125652,42.97364087262824,0 -122.4690976818836,42.97347321224328,0 -122.4683296730514,42.97347414985015,0 -122.4681758227892,42.97336087134529,0 -122.4681755607282,42.9733023385